import React, { useState } from 'react';
import axios from 'axios';

const TrainRegistration = () => {
  const [companyName, setCompanyName] = useState('');
  const [ownerName, setOwnerName] = useState('');
  const [rollNo, setRollNo] = useState('');
  const [ownerEmail, setOwnerEmail] = useState('');
  const [accessCode, setAccessCode] = useState('');
  const [clientID, setClientID] = useState('');
  const [clientSecret, setClientSecret] = useState('');

  const handleRegister = () => {
    const registerUrl = 'http://104.211.219.98/train/register';
    const registerPayload = {
      companyName,
      ownerName,
      rollNo,
      ownerEmail,
      accessCode
    };

    axios.post(registerUrl, registerPayload)
      .then(response => {
        if (response.status === 200) {
          const { companyName, clientID, clientSecret } = response.data;
          setCompanyName(companyName);
          setClientID(clientID);
          setClientSecret(clientSecret);
          console.log('Registration successful!');
        } else {
          console.log('Registration failed with status code:', response.status);
        }
      })
      .catch(error => {
        console.log('Error occurred during registration:', error);
      });
  };

  return (
    <div>
      <h2>Train Registration</h2>
      <label>
        Company Name:
        <input type="text" value={companyName} onChange={e => setCompanyName(e.target.value)} />
      </label>
      <br />
      <label>
        Owner Name:
        <input type="text" value={ownerName} onChange={e => setOwnerName(e.target.value)} />
      </label>
      <br />
      <label>
        Roll No:
        <input type="text" value={rollNo} onChange={e => setRollNo(e.target.value)} />
      </label>
      <br />
      <label>
        Owner Email:
        <input type="text" value={ownerEmail} onChange={e => setOwnerEmail(e.target.value)} />
      </label>
      <br />
      <label>
        Access Code:
        <input type="text" value={accessCode} onChange={e => setAccessCode(e.target.value)} />
      </label>
      <br />
      <button onClick={handleRegister}>Register</button>
      <br />
      <br />
      {clientID && (
        <div>
          <h3>Registration Details:</h3>
          <p>Company Name: {companyName}</p>
          <p>Client ID: {clientID}</p>
          <p>Client Secret: {clientSecret}</p>
        </div>
      )}
    </div>
  );
};

export default TrainRegistration;
